    "energy-policy-act",nt"isopen": false,nt"url": null,nt"notes": "The
    Energy Policy Act (EPA) addresses energy production in the United States, including:
    (1) energy efficiency; (2) renewable energy; (3) oil and gas; (4) coal; (5) Tribal
    energy; (6) nuclear matters and security; (7) vehicles and motor fuels, including
    ethanol; (8) hydrogen; (9) electricity; (10) energy tax incentives; (11) hydropower
    and geothermal energy; and (12) climate change technology. For example, the Act
    provides loan guarantees for entities that develop or use innovative technologies
    that avoid the by-production of greenhouse gases. - Source: http://energy.gov/sites/prod/files/2013/10/f3/epact_2005.pdf
    - Date Enacted: August 8, 2005 - Codification: 42 U.S.C. Sec. 15801 et seq. - Authority:
    U.S. Departments of Energy and the Interior, and U.S. Environmental Protection Agency
    When investigating geo-regulatory boundaries near the boundary edges, users should
    consult the most up to date applicable jurisdictional boundaries from all respective
    authoritative sources.",nt"license_title": null,nt"extras": [{ntt"key":
